import React, { useState } from "react";
import "./popup.css"

const PopupWindow = (props) => {

    const {label, buttonLeft, buttonRight, confirm, toggleVisibility, textfeild = false, textfeildLabel} = props;

    return (
        <div className='popup-container'>
            <span className="label">{label}</span>

            {textfeild && (
            <div type='textbox'> 
                <span>{textfeildLabel}</span>
                <input type='text'/>
            </div>
            )}

            <button onClick={() => confirm()}>{button1}</button>
            <button onClick={() => toggleVisibility()}>{button2}</button>
        </div>
    )

}

export default PopupWindow;
